import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Import components for each page
import Home from './components/Home';
import About from './components/About';
import CreateGame from './components/CreateGame';
import JoinGame from './components/JoinGame';
import GamePage from './components/GamePage';  // Ensure this import path is correct
import SecretCodePage from './components/SecretCodePage';

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/about" element={<About />} />
                <Route path="/create-game" element={<CreateGame />} />
                <Route path="/join-game" element={<JoinGame />} />
                <Route path="/game/:gameId" element={<GamePage />} />
                <Route path="/secretcode/c/:gameId" element={<SecretCodePage role="creator" />} />
                <Route path="/secretcode/j/:gameId" element={<SecretCodePage role="joiner" />} />
                <Route path="/game/c/:gameId" element={<GamePage role="creator" />} />
                <Route path="/game/j/:gameId" element={<GamePage role="joiner" />} />

            </Routes>
        </Router>
    );
};

export default App;
